document.addEventListener('click', function (event) {
  const toggle = event.target.closest('.toggle-password');
  if (!toggle) return;

  const inputControl = toggle.closest('.float-input-control');
  const input = inputControl.querySelector('.form-float-input');

  toggle.querySelector('i').classList.toggle('ti-eye');
  toggle.querySelector('i').classList.toggle('ti-eye-off');

  const newType = input.getAttribute('type') === 'password' ? 'text' : 'password';
  input.setAttribute('type', newType);
});
document.addEventListener("DOMContentLoaded", function () {
  "use strict";

  const digitInputs = document.querySelectorAll(".digit-input");

  function handleInput(input) {
      let val = input.value.replace(/\D/g, ""); // Remove non-digits
      input.value = val;
      input.classList.toggle("valid", val.length === 1);

      if (val.length === 1) {
          let nextInput = input.nextElementSibling;
          if (nextInput && nextInput.classList.contains("digit-input")) {
              nextInput.focus();
              nextInput.select();
          }
      }
  }

  function distributePastedData(pastedData) {
      const digits = pastedData.replace(/\D/g, "").split("");
      digitInputs.forEach((input, index) => {
          input.value = digits[index] || "";
          input.classList.toggle("valid", !!input.value);
      });

      let lastFilled = Array.from(digitInputs).findLast(input => input.value !== "");
      if (lastFilled) {
          let nextFocus = lastFilled.nextElementSibling;
          if (nextFocus && nextFocus.classList.contains("digit-input")) {
              nextFocus.focus();
              nextFocus.select();
          } else {
              lastFilled.focus();
              lastFilled.select();
          }
      }
  }

  digitInputs.forEach(input => {
      input.addEventListener("input", function () {
          handleInput(this);
      });

      input.addEventListener("keydown", function (e) {
          if (e.key === "Backspace" && !this.value) {
              let prevInput = this.previousElementSibling;
              if (prevInput && prevInput.classList.contains("digit-input")) {
                  prevInput.focus();
                  prevInput.select();
              }
          } else if (e.key === "ArrowLeft") {
              e.preventDefault();
              let prevInput = this.previousElementSibling;
              if (prevInput && prevInput.classList.contains("digit-input")) {
                  prevInput.focus();
                  prevInput.select();
              }
          } else if (e.key === "ArrowRight") {
              e.preventDefault();
              let nextInput = this.nextElementSibling;
              if (nextInput && nextInput.classList.contains("digit-input")) {
                  nextInput.focus();
                  nextInput.select();
              }
          }
      });

      input.addEventListener("paste", function (e) {
          e.preventDefault();
          let pastedData = (e.clipboardData || window.clipboardData).getData("text");
          distributePastedData(pastedData);
      });

      // Ensure numeric keyboard on mobile
      input.setAttribute("inputmode", "numeric");
      input.setAttribute("pattern", "[0-9]*");
  });
});
